import React, { Component } from 'react';
import Bootstrap, {
    Navbar,
  } from 'bootstrap-4-react';


const AppBar = () => {

    const Menu = props => (
        <div id="appBar">
             <div onClick={this.props.history.push('http://localhost:3000/')}>
             <h2 id="titulo"  >Wdemy </h2> 
             </div> 

        </div>
      )
    return (
        <>
           <div id="menu">
               <Menu />
           </div>
        </>
    )
}

export default AppBar
